import './Doctor.css';

export default function Doctor(props) {
  console.log(props.doctor.name);
  const { name, last_name} = props.doctor;

      return (
        <div className="doctor-card">
          <h1>doctor list here </h1>
            <div className="doctor-bio-left"> 
              Dr. {name} {last_name}
              <img src={props.photo} alt="" key={props.id} />
            </div>

            <div className="doctor-sched-right"> 
            doctor's schedule here
            </div>
        </div>
      )
    }
